import ExpenseItem from "./components/Expenses/ExpenseItem.js";

function App() {
  let expense = [
    {
      id: "1",
      date: new Date(2023, 6, 24),
      Title: "School Fee",
      Amount: 300,
    },
    {
      id: "2",
      date: new Date(2023, 6, 24),
      Title: "School Fee2",
      Amount: 785,
    },
    {
      id: "3",
      date: new Date(2023, 6, 24),
      Title: "School Fee3",
      Amount: 654,
    },
    {
      id: "4",
      date: new Date(2023, 6, 24),
      Title: "School Fee4",
      Amount: 540,
    },
  ];

  return (
    <div>
      <h2>Let's Get Started</h2>
      <ExpenseItem
        date={expense[0].date}
        title={expense[0].Title}
        amount={expense[0].Amount}
      />
      <ExpenseItem
        date={expense[1].date}
        title={expense[1].Title}
        amount={expense[1].Amount}
      />
      <ExpenseItem
        date={expense[2].date}
        title={expense[2].Title}
        amount={expense[2].Amount}
      />
      <ExpenseItem
        date={expense[3].date}
        title={expense[3].Title}
        amount={expense[3].Amount}
      />
    </div>
  );
}

export default App;
